INSERT INTO `acd_skripsijudul` (`id`, `date_in`, `mhs_id`, `prodi_id`, `pembimbing1_id`, `pembimbing2_id`, `pembimbing2_persetujuan`, `pembimbing2_komentar`, `judul`, `status`, `status_ket`, `status_sk`, `judul1`, `judul1_masalah`, `judul1_solusi`, `judul1_j1`, `judul1_j1l`, `judul1_j2`, `judul1_j2l`, `judul1_j3`, `judul1_j3l`, `judul2`, `judul2_masalah`, `judul2_solusi`, `judul2_j1`, `judul2_j1l`, `judul2_j2`, `judul2_j2l`, `judul2_j3`, `judul2_j3l`, `judul3`, `judul3_masalah`, `judul3_solusi`, `judul3_j1`, `judul3_j1l`, `judul3_j2`, `judul3_j2l`, `judul3_j3`, `judul3_j3l`) VALUES
('1a877a27673e4d4f9a67ff358c01b47b', '2025-06-24 10:07:53.558040', 'H0222015', 'd95cdba0f5154125ad54d0d7f8e1408c', NULL, NULL, NULL, NULL, NULL, 'Waiting', NULL, '-', 'Pengaruh  Media  Pembelajaran  Interaktif  Wordwall  Dalam  Meningkatkan  Minat Dan  Hasil Belajar  Siswa Pada  Pembelajaran  Matematika  Materi Bangun  Datar Kelas VII  SM', 'Rendahnya minat belajar siswa dikarenakan pembelajaran yang monoton dan kurang melibatkan siswa sehingga siswa merasa bosan dan berdampak pada hasil belajar siswa.', 'Dengan penggunaan media interaktif seperti Wordwall memberikan alternatif pembelajaran yang menarik dan mudah diakses melalui perangkat digital. Wordwall memungkinkan guru menyusun berbagai aktivitas edukatif seperti kuis dan permainan yang mendorong keterlibatan siswa. Melalui pendekatan learning by playing, siswa menjadi lebih termotivasi, aktif, dan tertantang dalam memahami materi, serta memperoleh umpan balik langsung untuk memperbaiki kesalahan secara cepat.', '1.	Penerapan Media Wordwall untuk Meningkatkan Minat Belajar Matematika pada Peserta Didik Kelas V Sekolah Dasar', 'https://jurnal.stikes-ibnusina.ac.id/index.php/INOVED/article/download/1778/2137/8280', '2.	Efektivitas Penggunaan Media Interaktif Wordwall pada Pembelajaran Matematika', 'https://journal.ummat.ac.id/index.php/justek/article/view/20467', '3.	Efektivitas Aplikasi Wordwall pada Materi Statistika di SMKN 1 Jabon', 'https://online-journal.unja.ac.id/msa/article/view/37538', 'Pengaruh Penggunaan Game Interaktif Math Ludo terhadap Partisipasi Aktif dan Pemahaman Konsep Siswa Pada Pembelajaran Matematika Kelas VIII', 'Kurangnya pemahamaan konsep siswa serta kurangnya partisipasi siswa pada saat pembelajaran matematika dikarenakan siswa yang takut salah saat menjawab soal dari guru serta tidak berminat mengikuti pembelajaran.', 'Untuk mengatasi masalah rendahnya partisipasi aktif dan kurangnya pemahaman konsep siswa dalam pembelajaran matematika, solusi yang ditawarkan adalah dengan menggunakan media pembelajaran inovatif berupa Ludo Matematika. Media ini merupakan permainan edukatif yang dirancang untuk menggabungkan unsur hiburan dan pembelajaran, sehingga menciptakan suasana belajar yang menyenangkan dan memotivasi siswa untuk lebih terlibat secara aktif. Melalui permainan Ludo Matematika, siswa akan dibagi ke dalam beberapa kelompok dan bergiliran melempar dadu untuk melangkah pada papan permainan. Setiap kotak tertentu berisi soal atau tantangan terkait materi yang sesuai. Untuk dapat melanjutkan permainan, siswa harus menyelesaikan soal yang tersedia. Hal ini mendorong siswa untuk berdiskusi, berpikir kritis, dan berpartisipasi aktif dalam menyelesaikan masalah secara bersama sama. Selain itu, soal-soal yang digunakan dalam permainan dirancang untuk memperkuat pemahaman konsep, bukan sekadar menghafal rumus. Soal disajikan dalam bentuk kontekstual dan disertai gambar atau situasi nyata, sehingga siswa dapat memahami makna sebenarnya.', '1.	Perancangan Eduboard Ludo untuk Mata Pelajaran Matematika', 'https://ojs.amikomsolo.ac.id/index.php/semnasa/article/view/101', '2.	PENGEMBANGAN MEDIA PEMBELAJARAN LUDO SMART MATH (LSM) UNTUK MEMBELAJARKAN KEMAMPUAN PEMAHAMAN KONSEP MAΤΕΜΑΤΙΚΑ MATRI BILANGAN PADA SISWA KELAS VII MTS S HAJIJAH AMALIA SARI BATUNADUA', 'https://journal.ipts.ac.id/index.php/MathEdu/article/view/6308', '3.	PENGGUNAAN MEDIA PEMBELAJARAN LUDO MATH PADA MATERI PERSAMAAN DAN FUNGSI KUADRAT DI KELAS IX SMPN 2 KOTA SOLOK', 'https://ojs.fkipummy.ac.id/index.php/theorems/article/view/968', 'Dampak Persepsi Siswa terhadap Interaksi Guru-Siswa dalam Pembelajaran Matematika terhadap Motivasi Belajar Siswa', 'Motivasi belajar siswa seringkali dipengaruhi oleh persepsi mereka terhadap interaksi dengan guru.  Interaksi yang kurang efektif, seperti komunikasi satu arah, minimnya empati, atau kurangnya perhatian terhadap kebutuhan individu siswa, dapat menurunkan motivasi belajar.', 'Guru perlu meningkatkan kemampuan komunikasi interpersonal dengan memberi ruang bagi siswa untuk bertanya, mendengarkan secara aktif, serta menyampaikan umpan balik yang membangun. Pendekatan pembelajaran yang partisipatif dan humanis, seperti diskusi atau kerja kelompok, juga perlu diterapkan. Selain itu, penggunaan media pembelajaran yang interaktif dan relevan akan mempererat hubungan emosional antara guru dan siswa, sehingga membentuk persepsi positif yang mendorong motivasi belajar matematika.', '1.	Pengaruh Persepsi Siswa pada Pelaksanaan Pembelajaran Matematika Guru terhadap Motivasi Belajar Matematika Siswa SMP Negeri 6 Samarinda', 'https://jurnal.fkip.unmul.ac.id/index.php/semnasppg/article/view/4155', '2.	Pengaruh Persepsi Siswa tentang Guru Matematika terhadap Motivasi Belajar Matematika Siswa', 'https://journal.unwira.ac.id/index.php/ASIMTOT/article/view/1365', '3.	PENGARUH PERSEPSI SISWA TENTANG GURU MATEMATIKA TERHADAP MOTIVASI BELAJAR MATEMATIKA SISWA', 'https://www.researchgate.net/publication/356923356_PENGARUH_PERSEPSI_SISWA_TENTANG_GURU_MATEMATIKA_TERHADAP_MOTIVASI_BELAJAR_MATEMATIKA_SISWA'),
('271244e9755b4491bc537a0ccd1aff6e', '2025-06-17 12:52:40.758626', 'H0221001', 'd95cdba0f5154125ad54d0d7f8e1408c', '198703052019031007', '199309282022032013', 'Approved', 'Diterima masalahnya', 'PENGARUH PEMBELAJARAN PAIR CHECKS TERHADAP KEMAMPUAN BERPIKIR KRITIS DALAM MENYELESAIKAN SOAL CERITA SISWA KELAS VIII MTS NEGERI 1 MAEJENE', 'ACC Judul 2', NULL, 'Terbit', 'PENGARUH METODE PEMBELAJARAN DRILL TERHADAP KEMAMPUAN PEMECAHAN MASALAH SISWA KELAS VIII MTsN 1 MAJENE”', 'Permasalahan yang dihadapi peserta didik MTsN 1 MAJENE yaitu rendahnya kemampuan pemecahan masalah yang dibuktikan dengan masih kurangnya konsep dasar matematika siswa. Berdasarkan hasil observasi dan wawancara dengan guru, faktor penyebabnya adalah: - Siswa kurang yakin pada diri mereka bahwa ia mampu menyelesaikan masalah dan kurang yakin dengan jawaban mereka sendiri. - Sistematika penyelesaian masalah yang tidak sesuai dengan langkah – langkah penyelesaian yang dapat memberikannya kemudahan Penguasaan konsep matematika dasar yang kurang seperti perkalian, pembagian dan konsep dasar lainnya sehingga menghambat proses penyelesaian masalah', 'Solusi yang dapat dilakukan yaitu pengembangan perangkat metode pembelajaran yang sesuai dengan kebutuhan peserta didik seperti metode pembelajaran drill. Roestiyah mengungkapkan bahwa metode drill adalah suatu cara mengajar di mana peserta didik melaksanakan kegiatan- kegiatan latihan, peserta didik memiliki ketangkasan atau keterampilan yang lebih tinggi dari apa yang telah dipelajari (Roestiyah, 1985: 125). Melalui pembelajaran drill soalsoal pemecahan masalah, siswa akan berusaha menemukan penyelesaiannya melalui berbagai strategi pemecahan masalah matematika sehingga siswa akan memiliki keterampilan pemecahan masalah yang jauh lebih baik.', 'ELLI KUSUMAWATI, RANDI.A,R (2016):PENERAPAN METODE PEMBELAJARAN DRILL UNTUK MENINGKATKAN KEMAMPUAN PEMECAHAN MATEMATIS SISWA KELAS VIII SMP.', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/446_file_1.pdf', 'YUNDA KURNIAWAN (2016): PENINGKATAN KEMAMPUAN PEMECAHAN MASALAH MATEMATIK SISWA MELALUI PEMBELAJARAN DENGAN MENGGUNAKAN METODE DRIL', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/446_file_2.pdf', 'SUVRIADI PANGGABEAN, dkk (2018): PENGARUH METODE DRILL TERHADAP HASIL BELAJAR MATEMATIKA SISWA SMP PERTIW MEDAN”.', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/446_file_3.pdf', 'PENGARUH PEMBELAJARAN PAIR CHECKS TERHADAP KEMAMPUAN BERPIKIR KRITIS DALAM MENYELESAIKAN SOAL CERITA SISWA KELAS VIII MTS NEGERI 1 MAEJENE', 'Rendahnya hasil belajar siswa di MTsN 1 Majene.Hal ini dapat dilihat pada saat mid semester, banyak dari beberapa siswa kelas VIII tidak memenuhi KKM, karena kemampuan berpikir kritis siswa dalam pembelajaran matematika yang sangat kurang sehingga berdampak pada hasil belajar siswa. Keterampilan berpikir kritis dapat diketahui dari indicator penilaian. -Memberikan penjelasan sederhana - Membangun keterampilan dasar - Menyimpulkan - Memberikan penjelasan lanjut -Mengatur strategi dan Teknik Wardani dalam Sunaryo (2014: 5) Menyatakan bahwa indicator berpikir kritis yakni sebagai berikut : - Kefasihan - Keluwesan - Keaslian yang relative baru -Keterincian/elaborasi', 'Solusi yang dapat dilakukan yaitu dengan melihat sejauh mana kemampuan berpikir kritis siswa dalam menyelesaikan soal cerita kelas VIII MTsN 1 MAJENE', 'IKHLAS AGEN MUNASABAH TELAUMBANUA,DKK (2024) PENGARUH MODEL PEMBELAJARAN PAIR CHECK TERHADAP KEMAMPUAN PEMECAHAN MASALAH MATEMATIKA SMP NEGERI 2 SAWO', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/446_file_4.pdf', 'N.M.C.T.Dewi, DKK (2021) PENGARUH MODEL PEMBELAJARAN KOOPERATIF TIPE PAIR CHECK TERHADAP PEMAHAMAN KOSEP MATEMATIKA SISWA KELAS VII SMP NEGERI 1 MARGA', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/446_file_5.pdf', 'Ramadhani, S. S., Hartin, S., & Lestari, W. D. (2019). Pengaruh Penggunaan Model Pembelajaran Pair Check Terhadap Kemampuan Berpikir Reflektif Siswa Ditinjau Dari Tingkat Kebiasaan Berpikir.', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/identifikasi_lihat_pdf.php?namafile=446_file_6.pdf', 'PENGEMBANGAN PERANGKAT AJAR) BERBASIS MODEL ICARE (INTRODUCTI ON, CONNECT, APPLY, REFLECT, EXTEND) UNTUK MENINGKATAN MINAT HASIL BELAJAR MATEMATIKA DI MTsN 1 MAJENE.', 'Kurangnya minat belajar siswa dalam belajar matematika dibuktikan dengan rendahnya hasil belajar siswa. Berdasarkan hasil observasi dan wawancara dengan guru, faktor penyebabnya adalah: -Peserta didik lebih sering mengobrol bersama teman pada saat proses pembelajaran. - Pada saat kerja kelompok masih banyak siswa yang kurang aktif dalam diskusi.', 'Solusi untuk permasalahan kurangnya minat belajar siswa dalam belajar matematika yaitu Salah satunya dengan menggunakan Model Pembelajaran ICARE (Introduction. Connect, Apply, Reflect, Extend). Model Pembelajaran ICARE dapat memudahkan penerapan pengetahuan yang telah di pelajari peserta didik di kehidupan seharihari. ICARE terdiri dari lima unsur yaitu introduction (pengenalan), connection (menghubungkan), application (mengaplikasikan), reflection (refleksi) dan extension (melanjutkan). Terkait edukasi minat belajar terhadap siswa itu juga penting. Agar saat proses pembelajaran berlangsung siswa bisa fokus pada materi dan tidak ngobrol. Memberikan fasilitas yang diminati oleh siswa.', 'PENDEKATAN ICARE INTRODUCTION, CONNECT, APPLY, REFLECT, EXTEND) DALAM LKPD PELAJARAN MATEMATIKA KELAS VII SMP.', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/446_file_7.pdf', 'PENGEMBANGAN MODUL PEMBELAJARAN MATEMATIKA BERBASIS ICARE (Introduction, Connection, Application, Reflection dan Extention) UNTUK MENINGKATKAN KEMANDIRIAN BELAJAR SISWA.', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/446_file_8.pdf', 'PENGEMBANGAN LKPD BERBASIS ICARE (INTRODUCTION, CONNECT, APPLY, REFLECT, EXTEND) PADA MATERI PENENTUAN PERUBAHAN ENTALPI UNTUK SMA/MA', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/446_file_9.pdf'),
('450715f8c637469d87f7a0290e46034e', '2025-06-25 04:08:24.280996', 'H0222016', 'd95cdba0f5154125ad54d0d7f8e1408c', NULL, NULL, NULL, NULL, NULL, 'Waiting', NULL, '-', 'PENGEMBANGAN E-MODUL INTERAKTIF BERBASIS CANVA BANTUAN HEYZINE FLIPBOOK UNTUK MENINGKATKAN MOTIVASI BELAJAR SISWA SMP NEGERI 2 BALANIPA', 'Guru jarang menggunakan LCD ( pawer Point ) saat pembelajaran berlangsung, \r\nGuru hanya mengajarkan hanya dengan menggunakan metode ceramah saja\r\nSiswa merasa bosan saat menerima pembelajaran  yang monoton karena hanya mengajarkan dengan metode ceramah', 'Dengan bantuan E_Modul Interaktif Kiranya siswa lebih termottivasi dalam proses pembelajaran. Karena siswa mersasa bosan dan pembelajaran yang monoton, E-Modul Interaktif Mungkin bisa Menambah motivasi dalam pembelajaran Matematika', 'Pengembangan E-Modul Interaktif Berbasis Aplikasi Canva Dan Heyzine Flipbook Untuk Meningkatkan Minat Belajar Siswa Dalam Pembelajaran Bahasa Arab Di Kelas X.1 Man 1 Kota Pekalongan', 'http://etheses.uingusdur.ac.id/11614/', 'PENGEMBANGAN E-MODUL INTERAKTIF HEYZINE FLIPBOOK BERBASIS SCIENTIFIC MATERI SIKLUS AIR KELAS V SDN BARENG 5 MALANG', 'https://journal2.um.ac.id/index.php/sd/article/downloadSuppFile/29433/7604', 'Pengembangan E-Modul Berbasis Heyzine Flipbook pada Mata Pelajaran Otomatisasi Humas dan Keprotokolan di SMKN 2 Buduran Sidoarjo', 'https://j-innovative.org/index.php/Innovative/article/download/8126/5527/12889', 'PENGEMBANGAN VIDEO PEMBELAJARAN MATEMATIKA INTERAKTIF DITINJAU DARI KEMAMPUAN NUMERASI SISWA SMP NEGERI 2 BALANIPA', 'Dari hasil observasi dan wawancara dengan Ibu Huspania  selaku guru matematika, ternyata media pembelajaran khususnya video pembelajaran belum pernah dilaksanakan di SMP Negeri 2 balanipa', 'Karena siswa belum pernah belajar dengan video pembelajaran interaktif  maka dari itu saya bertujuzn untuk menggunakan video interaktif agar supaya siswa lebih tertarik dalam belajara', 'Pengembangan Video Pembelajaran Matematika untuk Memfasilitasi Kemandirian Belajar Siswa', 'https://seminar.uad.ac.id/index.php/SNTEKAD/article/download/16059/5368', 'PENGEMBANGAN VIDEO PEMBELAJARAN INTERAKTIF UNTUK MENINGKATKAN KETERAMPILAN LITERASI MATEMATIKA MATERI BANGUN RUANG SISI DATAR', 'https://jurnal.unigal.ac.id/J-KIP/article/view/14591', 'Pengembangan Video Pembelajaran Berbasis Numerasi dengan Kearifan Lokal Untuk Siswa SD', 'https://ejournal.unma.ac.id/index.php/educatio/article/download/2748/1867/12997', 'PENGEMBANGAN MEDIA VIDEO ANIMASI BERBASIS APLIKASI CANVA UNTUK MENINGKATKAN PEMAHAMAN MATEMATIKA SISWA SMP NEGERI 2 BALANIPA', 'siswa sulit memahami materi dengan baik, karena pembelajaran yang membosankan , serta guru hanya menggunakan metode komvensional saat penjelaskan materi  sehingga siswa kurang paham materi yang diajarkan oleh guru', 'Dengan Penggunaan bahan ajar seperti video, siswa akan lebih paham dan lebih termotivasi, dan lebih semangat dalam menyimak pembelajaran  mengenai materi yang diajarkan,', 'Pengembangan Media Video Animasi Berbasis Canva untuk Menstimulus Kemampuan Komunikasi Matematis Siswa Authors Reza Lestari STKIP Muhammadiyah Pagaralam Tri Rohani STKIP Muhammadiyah Pagaralam Syaiful Bastari SD Negeri 3 Gumay Ulu DOI: https://doi.org/10.', 'https://jurnal.univpgri-palembang.ac.id/index.php/indiktika/article/view/16841', 'Pengembangan Video Animasi Menggunakan Aplikasicanva Untuk Meningkatkan Motivasi Belajar Dan Pemahaman Konsep KPK Dan FPB', 'https://ojs.unm.ac.id/JIKAP/article/download/35769/20165', 'PENGEMBANGAN MEDIA VIDEO PEMBELAJARAN MATEMATIKA UNTUK MENINGKATKAN HASIL BELAJAR SISWA KELAS VI SD NEGERI 2 SEPANG JAYA BANDAR LAMPUNG', 'http://digilib.unila.ac.id/75405/3/3.%20TESIS%20TANPA%20BAB%20PEMBAHASAN.pdf'),
('65c89c706e2d49e2a6b86f727e5edc1f', '2025-06-17 12:43:27.077007', 'H0221016', 'd95cdba0f5154125ad54d0d7f8e1408c', '198703052019031007', '198304302021212009', 'Waiting', NULL, 'Pengaruh penggunaan game online  terhadap hasil belajar matematika  dengan motivasi belajar matematika  sebagai variabel intervening pada siswa  Kelas VIII SMPN 2 Balanipa.', 'ACC Judul 3', NULL, '-', 'Pengaruh gaya belajar siswa terhadap  hasil belajar matematika dengan  kemandirian belajar Sebagai Variabel  Intervening Pada siswa Kelas VIII  SMPN 2 Balanipa.', '1. Gaya belajar siswa \r\nSMPN 2 Balanipa \r\ncenderung berbedabeda.\r\n2. Kemandirian dalam \r\nbelajar matematika \r\npada siswa SMPN 2 \r\nBalanipa cenderung \r\nrendah.\r\n3. Hasil belajar \r\nmatematika siswa \r\nSMPN 2 Balanipa \r\nrendah', 'Mencari pengaruh Gaya \r\nBelajar Siswa Terhadap \r\nHasil Belajar Matematika \r\ndengan Kemandirian \r\nBelajar Sebagai Variabel \r\nIntervening Pada Siswa\r\nKelas VIII SMPN 2 \r\nBalanipa.', 'Pengaruh gaya belajar dan kemandirian  belajar terhadap kemampuan pemecahan  masalah matematika siswa di sman 1  majene', 'https://doi.org/10.46306/lb.v3i3.170', 'Pengaruh gaya belajar terhadap hasil  belajar matematika di sd negeri sukaharja  01 kabupaten bogor', 'https://doi.org/10.33751/jssah.v2i1.6094', 'Pengaruh kemandirian belajar terhadap  hasil belajar matematika di smkn 1  cihampelas', 'https://doi.org/10.31004/joe.v1i2.78', 'Pengaruh kondisi ekonomi orang tua  terhadap prestasi belajar matematika  pada siswa Kelas VIII SMPN 2  Balanipa.', '1. Kondisi ekonomi orang \r\ntua siswa SMPN 2 \r\nBalanipa cenderung \r\nberagam.\r\n2. Prestasi\r\nbelajar \r\nmatematika siswa \r\nSMPN 2 Balanipa  rendah', 'Mencari pengaruh kondisi \r\nekonomi orang tua \r\nterhadap prestasi belajar \r\nmatematika pada siswa \r\nKelas VIII SMPN 2 \r\nBalanipa.', 'Pengaruh Perhatian Orang Tua, Konsep  Diri Dan Motivasi Belajar Terhadap Hasil  Belajar Siswa Tentang Matematika Kelas  Viii Smp Negeri Di Kecamatan Sausu  Kabupaten Parigi Moutong', 'https://doi.org/10.22487/mitrasains.v5i2.7 4', 'Pengaruh status sosial ekonomi orangtua terhadap hasil belajar  matematika siswa kelas VIII SMP Negeri  10 Padangsidimpuan', 'http://etd.uinsyahada.ac.id/id/eprint/2267', 'Pengaruh perhatian orang tua, motivasi  belajar, dan lingkungan sosial terhadap  prestasi belajar matematika pada siswa  smp', 'http://dx.doi.org/10.25157/jkip.v4i1.10133', 'Pengaruh penggunaan game online  terhadap hasil belajar matematika  dengan motivasi belajar matematika  sebagai variabel intervening pada siswa  Kelas VIII SMPN 2 Balanipa.', '1. Siswa SMPN 2 \r\nBalanipa \r\nrata-rata \r\nmenggunakan game \r\nonline.\r\n2. Motivasi belajar \r\nmatematika siswa \r\nSMPN 2 Balanipa \r\ncenderung rendah.\r\n3. Hasil belajar \r\nmatematika siswa \r\nSMPN 2 Balanipa \r\nrendah.', 'Mencari pengaruh \r\npenggunaan game online \r\nterhadap hasil belajar \r\nmatematika dengan \r\nmotivasi belajar \r\nmatematika sebagai \r\nvariabel intervening pada \r\nsiswa Kelas VIII SMPN 2 \r\nBalanipa.', 'Pengaruh bermain game online  terhadap prestasi belajar matematika  siswa', 'http://dx.doi.org/10.22373/jppm.v4i2.784 0', 'Pengaruh Game Online Terhadap  Pembelajaran Matematika: Studi Pustaka', 'https://seminar.ustjogja.ac.id/index.php/S EMANTIK/article/view/1898', 'Hubungan Antara Intensitas Bermain  Game Online Dengan Motivasi Belajar  Siswa Kelas X SMK Negeri 1 Sapuran  Kabupaten Wonosobo', 'http://repository.uksw.edu/handle/123456 789/3563'),
('6b00781d3e4a41c9939ec96fd48975a9', '2025-06-24 07:15:12.341371', 'H0219023', 'd95cdba0f5154125ad54d0d7f8e1408c', '198703052019031007', '0024059203', 'Approved', 'Silakan dilanjutkan', 'Pengembangan Media Video Animasi Berbasis Aplikasi Canva untuk meningkatkan motivasi dan Prestasi Belajar siswa Kelas X SMKN 1 Mehalaan.', 'ACC Judul 1', NULL, 'Terbit', 'Pengembangan Media Video Animasi Berbasis Aplikasi Canva untuk meningkatkan motivasi dan Prestasi Belajar siswa Kelas X SMKN 1 Mehalaan.', 'Guru mengajar hanya berpatokan pada buku yaitu hanya menjelaskan dan memberikan tugas tanpa berbantukan media video pembelajaran utuk meningkatkan motivasi belajar siswa sehingga berakibat kurangnya motivasi belajar siswa yang berakibat pada rendahhnya hasil belajar siswa.', 'Merancang media video animasi berbasis aplikasi canva pembelajaran matematika yang mampu mendukung berjalannya proses pembelajaran untuk meningkatkan motivasi dan prestasi belajar siswa.', 'Pengembangan Media Video Animasi Berbasis Aplikasi Canva untuk meningkatkan motivasi dan Prestasi Belajar siswa.', 'https://jbasic.org/index.php/basicedu/article/view/1237', 'Pengembangan media audio visual berbasis aplikasi canva materi bagun ruang limas.', 'https://jurnal.fkip.unila.ac.id/index.php/MTK/article/view/22490/0', 'Pengembangan media pembelajaran berbasis video animasi kartun di sekolah dasar.', 'https://ojs.unm.ac.id/CER/article/download/19117/10114', 'Upaya mengatasi kesulitan belajar matematika pada siswa pada pokok bahasan Operasi hitung bilangan bulat kelas VII SMP Negeri 024 RANTEBULAHAN TIMUR', 'Masalah yang saya dapatkan dari salah siswa yang saya teliti Masalah yang saya dapatkan ialah kurangnya minat belajar matematika siswa terhadap soal cerita dalam kehidupan sehari-hari pelajaran Matematika khususnya dalam materi bangun ruang Saat guru menjelaskan satu kali masih ada saja siswa yang belum Paham dikarenakan Ada yang kurang Memperhatikan, tidak serius dalam belajar. Dari sini siswa cenderung mangatakan bahwa matematika itu adalah ilmu yang paling sulit.', 'Memberikan pengertian dan pemahaman bagi siswa bahwa matematika tidaklah sulit melainkan mudah adanya jika kita ingin belajar dan berlatih mengerjakan soal serta merancang pembelajaran Matematika baik itu berupa model pembelajaran, video pembelajaran, alat peraga dan lain-lain yang mampu mendukung berjalannya proses pembelajaran dengan baik di kelas.', 'Upaya guru dalam mengatasi siswa berkesulitan belajar matematika di kelas IV SDIT Ukhuwah Banjarmasin.', 'https://jurnal.uin-antasari.ac.id/index.php/ptkpend/article/download/1028/803', 'Faktor-faktor kesulitan belajar matematika siswa madrasah ibtidaiyahdaâ€™watulfalah Kecamatan Tegaldlimo Kab.Banyuwangi', 'https://educare.uinkhas.ac.id/index.php/jie/article/view/14', 'Analisis kesulitan belajar matematika siswa pada pokok bahasan bangun ruang sisi datar diSMP Negeri 2 Bandung.', 'https://ojs.fkip.ummetro.ac.id/index.php/matematika/article/view/3586', 'Desain didaktis pembelajaran matematika untuk mengatasi hambatan epistimologis pada konsep operasi hitung Bilangan Bulat pada siswa kelas VII SMP Negeri 024 RANTEBULAHAN TIMUR', 'Dalam proses pembelajaran matematika banyak sekali siswa yang masih mengalami kesulitan dalam materi pembelajaran matematika serta memiliki kesalahan dalam memahami konsep matematika.', 'Membuat desain didaktis yang dilengkapi dengan prediksi respon siswa, untuk mengatasi atau mengurangi kesulitan dan kesalahan siswa dalam menyelesaikan permasalahan matematika.', 'Desain didaktis pembelajaran matematika untuk mengatasi hambatan epistimologis pada konsep limit fungsi aljabar', 'http://digilib.uinsa.ac.id/3651/', 'Desain Didaktis Pembelajaran Matematika untuk Mengatasi Hambatan Epistimologis pada Konsep Program Linear di SMA', 'https://repository.uinjkt.ac.id/dspace/handle/123456789/70596', 'Desain didaktis pembelajaran matematika untuk mengatasi hambatan belajar pada materi matriks', 'https://journal.uinsgd.ac.id/index.php/analisa/article/view/5694'),
('95b5b37db2a6484d8c4e7e14fc78ea15', '2025-06-17 13:33:19.828469', 'H0221322', 'd95cdba0f5154125ad54d0d7f8e1408c', NULL, NULL, NULL, NULL, NULL, 'Waiting', NULL, '-', '“Implementasi strategi game based learning dalam meningkatkan pemahaman konsep dasar matematika SMP \"', 'Kurangnya pemahaman konsep dasar siswa terhadap konsep matematika dasar, seperti penjumlahan, pengurangan, perkalian, dan pembagian, mereka mungkin kesulitan dalam memahami materi yang lebih kompleks. Masalah ini bisa timbul karena kurangnya pemahaman yang tepat sebelumnya atau kurangnya penguasaan yang konsisten terhadap konsep dasar .', 'Untuk mengatasi masalah kurangnya pemahaman konsep dasar siswa dalam matematika, terutama penjumlahan, pengurangan, perkalian, dan pembagian, ada beberapa solusi yang dapat diterapkan: 1. Penguatan Konsep Dasar: Penting untuk memberikan perhatian khusus pada pemahaman dan penguasaan konsep dasar. Guru dapat meluangkan waktu untuk menjelaskan konsep-konsep dasar secara menyeluruh dan memastikan bahwa setiap siswa benar-benar memahaminya sebelum melanjutkan ke materi yang lebih kompleks. 2. Pengulangan dan Praktik Yang Dikonsistenkan: Mengulang dan mempraktikkan konsep dasar secara konsisten sangat penting. Guru dapat merancang kegiatan dan latihan yang memungkinkan siswa untuk terus memperkuat pemahaman mereka tentang penjumlahan, pengurangan, perkalian, dan pembagian secara berulang-ulang. 3. Pembelajaran Diferensiasi: Setiap siswa memiliki kecepatan dan gaya belajar yang berbeda. Oleh karena itu, penting bagi guru untuk menerapkan pendekatan pembelajaran diferensiasi,di mana mereka memberikan dukungan tambahan atau materi tambahan kepada siswa yang membutuhkannya untuk memperkuat pemahaman konsep dasar. 4. Penggunaan Alat Bantu dan Manipulatif: Alat bantu dan manipulatif matematika, seperti blok bangunan, koin, dan kartu, dapat membantu siswa memvisualisasikan konsep-konsep dasar dengan lebih baik. Guru dapat mengintegrasikan penggunaan alat bantu ini ke dalam pembelajaran untuk membantu siswa memahami konsep-konsep secara konkret. 5. Pembelajaran Berbasis Proyek: Mengintegrasikan pembelajaran matematika ke dalam proyek-proyek yang relevan dengan kehidupan sehari-hari atau topik yang menarik bagi siswa dapat membantu mereka melihat aplikasi praktis dari konsep-konsep dasar matematika. 6. Kolaborasi dengan Orang Tua: Melibatkan orang tua dalam memperkuat pemahaman konsep dasar matematika di rumah juga penting. Guru dapat memberikan saran kepada orang tua tentang cara mereka dapat mendukung pembelajaran matematika anak-anak mereka di rumah. 7. Evaluasi Berkelanjutan: Guru perlu terus memantau kemajuan siswa dalam memahami konsep dasar matematika dan memberikan umpan balik yang konstruktif. Evaluasi berkelanjutan dapat membantu mengidentifikasi siswa yang membutuhkan bantuan tambahan dan menyesuaikan pendekatan pembelajaran sesuai kebutuhan mereka.', 'Penerapan Game Based Learning untuk Meningkatkan Pemahaman Konsep Operasi Hitung Bilangan Bulat Siswa Kelas V Sekolah Dasar Negeri 4', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/428_file_1.pdf', 'PENGARUH GAME BASED LEARNING TERHADAP KEMAMPUAN PEMECAHAN MASALAH SISWA MATERI LINGKARAN KELAS VIII SMP NEGERI 18 KOTA BENGKULU', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/428_file_2.pdf', '. Pengaruh Model Pembelajaran Kontekstual terhadap Pemahaman Konsep Matematika Siswa SMP Penulis.', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/428_file_3.pdf', '\"Meningkatkan Keterampilan Berpikir Kritis Siswa dalam Pembelajaran Matematika melalui Penggunaan Umpan Balik Guru terhadap metode pembelajaran yang Efektif\"', 'kurangnya umpan balik yang konstruktif Terhadap Model pembelajaran. guru-guru kadang tidak memberikan umban balik kepada siswa-siswinya atau tidak memberikan kesempatan kepada siswanya untuk berekspresi atau memberikan pendapat pada saat proses pembelajaran berlangsung sehingga siswa juga kadang merasa bosan dan bahkan tidak mengerti apa yang dijelaskan gurunya.', 'Masalah kurangnya umpan balik yang konstruktif dalam proses pembelajaran ini dapat memiliki dampak negatif pada motivasi dan pemahaman siswa. Untuk mengatasi masalah ini, berikut adalah beberapa solusi yang bisa diimplementasikan: 1. Pelatihan Guru Memberikan pelatihan kepada guru-guru tentang pentingnya dan cara memberikan umpan balik yang konstruktif kepada siswa. Pelatihan ini harus mencakup teknik-teknik efektif untuk memberikan umpan balik yang mendukung perkembangan siswa, seperti memberikan pujian yang spesifik, mengidentifikasi kesalahan dengan jelas, dan memberikan saran perbaikan yang konstruktif. 2. Membuat Lingkungan Pembelajaran Terbuka Menciptakan lingkungan pembelajaran di mana siswa merasa nyaman untuk bertanya dan berpartisipasi aktif dalam diskusi. Guru perlu memberikan dukungan dan dorongan kepada siswa untuk berbagi pemikiran dan pertanyaan mereka, serta memberikan umpan balik yang positif terhadap partisipasi mereka.', 'PERMASALAHAN PEMBELAJARAN MATEMATIKA DI SEKOLAH DASAR', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/428_file_4.pdf', 'PENERAPAN MODEL PEMBELAJARAN GENERATIF UNTUK MENINGKATKAN KEMAMPUAN KOMUNIKASI MATEMATIS SISWA', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/428_file_5.pdf', 'BERMAIN DAN BELAJAR DENGAN KAHOOT!: MENINGKATKAN KETERLIBATAN SISWA SMP MENGGUNAKAN GAME DIGITAL', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/428_file_6.pdf', '\"Analisis Persepsi Siswa terhadap Matematika dan Kecemasan yang Mereka Rasakan dalam Pembelajaran Matematika\"', 'Ketakutan atau kecemasan terhadap matematika merupakan tantangan serius yang dihadapi oleh banyak siswa di berbagai tingkatan pendidikan. Fenomena ini memengaruhi kualitas pembelajaran matematika dan hasil akademis siswa secara keseluruhan. Beberapa faktor yang berkontribusi terhadap masalah ini termasuk pengalaman negatif sebelumnya, persepsi subjektif tentang kesulitan matematika, dan tekanan dari lingkungan sekolah dan keluarga.', '1. Pendekatan Pembelajaran Berbasis Keterlibatan: Menggunakan pendekatan pembelajaran yang interaktif dan berbasis pada keterlibatan siswa untuk meningkatkan minat dan motivasi mereka terhadap matematika. 2. Pengembangan Keterampilan Penanganan Stres: Menyediakan pelatihan dan dukungan untuk siswa dalam mengembangkan strategi penanganan stres yang efektif, termasuk teknik relaksasi dan manajemen waktu. 3. Membangun Dukungan Sosial: Mendorong kolaborasi antara siswa dan membangun dukungan sosial di antara mereka untuk saling membantu dan memotivasi satu sama lain dalam memahami materi matematika.', 'Kecemasan Siswa Dalam Menyelesaikan Masalah Modelling Matematika Pada Praktek Kelas Virtual', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/428_file_7.pdf', 'HUBUNGAN ANTARA GAYA PENGASUHAN ORANG TUA, EFIKASI DIRI MATEMATIKA DAN KECEMASAN MATEMATIKA', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/428_file_8.pdf', 'Identifikasi Kecemasan Matematika dan Motivasi Belajar Terhadap Hasil Belajar Matematika Siswa', 'https://sijuri.unsulbar.ac.id/matematika/ajukan/pdfidentifikasi/428_file_9.pdf');
